Dans le cadre du développement du Big Data au sein de la Cnav, un poste de data scientist est à pourvoir dans le pôle Production statistiques nationales.
Ce pôle, composé de 6 statisticiens, a pour principales missions de :
collecter, produire puis publier les statistiques de la branche vieillesse du régime général et assurer le suivi de la montée en charge de dispositifs législatifs ;
participer à la maintenance du système d'information statistique (SNSP : Système National Statistiques Prestataires) ;
mener des études et opérations avec le réseau de statisticiens des caisses régionales ;
participer, avec les autres unités à la valorisation des études et travaux de la DSPR ainsi qu'aux réponses aux demandes internes et externes.

Le pôle doit investir fortement à court et moyen termes pour assurer la continuité de ses productions et pour les adapter dans un contexte d'évolutions majeures des systèmes d'information. Il doit mettre en place des accès efficaces et juridiquement sécurisés à des jeux de données individuelles rapprochant des sources différentes (prestations retraite, carrières, action sociale …) afin de mener des opérations de datamining.
Missions
Vos principales missions seront de :
participer à des opérations de datamining avec d'autres chargés d'études de la DSPR ;
développer des modèles prédictifs depuis des bases de données distribuées sur un système de stockage Hadoop (avec une éventuelle mise en production) (exemples : travaux sur le non recours aux droits, fraude) ;
développer et mettre en production des modules de data visualisation (basés par exemple sur les packages dash/plotly de python) ;
participer à l'administration du serveur de data science de la plateforme Big Data et dans ce cadre assurer le lien avec les informaticiens de la Cnav (Miad de Tours).
Profil candidat
Ce poste requiert une forte autonomie, une capacité à travailler en équipe, de bonnes qualités relationnelles (liens avec les autres personnes de la direction, avec les équipes informatiques …), une bonne maîtrise des communications orales et écrites (conduite de réunion, animation de groupe, réalisation de présentation), une capacité à prendre des initiatives et être force de proposition.
Diplômé(e) d'une école d'ingénieur ou Master 2 en informatique et statistiques.
Vous justifiez d'une première expérience dans le Big Data et la Data Science et vous connaissez idéalement les langages et outils suivants :
python (dont les packages pyspark, mllib, pandas, numpy, sklearn, plotly, dash…)
R
scala ;
spark (nécessaire pour exploiter des données distribuées sur un cluster Hadoop) ;
notebook Jupyter ou IDE de type RStudio ;
invite de commande ;
HDFS ;
HIVE ;
ecosystème Hadoop (une expérience sur une plateforme Cloudera serait un plus).
Rémunération brute annuelle (K€)
40.7 K€ à 46.9 K€ en fonction du profil et de l'expérience
Pour information
La Direction Statistiques, Prospective et Recherche (DSPR) de la Cnav assure la production et la valorisation de statistiques, d'analyses quantitatives, d'évaluations, de projections et de recherches, pour contribuer à éclairer les décisions :
en matière de pilotage stratégique des politiques publiques (retraite et action sociale) [pôle Prévision, pôle Evaluation, Unité de recherche sur le vieillissement, service Editions scientifiques] ;
en matière de pilotage stratégique de la branche [pôle Production statistiques nationales, pôle Appui statistique à la branche].
La DSPR compte environ 50 collaborateurs, pour la plupart chargés de travaux statistiques et de recherche qui interagissent avec la Cnav et les partenaires extérieurs.
Le saviez-vous ?
Notre Direction « Statistiques, Prospective et Recherche » a son propre site, n'hésitez pas à le consulter : http://www.statistiques-recherches.cnav.fr/
Postuler

Le Datalab de Saint Gobain est une équipe de 20 data scientists qui travaille pour l’ensemble des activités du Groupe. Le Datalab intervient sur les grands enjeux de transformation digitale du Groupe, avec d’une part des projets liés à l’industrie 4.0 (amélioration de la production industrielle, optimisation de la supply chain), et d’autre part des projets liés à l’exploitation des données commerciales (algorithmes pour les plateformes de e-commerce et de développement des ventes).
Au sein du Datalab, vos missions seront les suivantes :
collaborer avec les activités et entités du groupe pour cadrer leur besoin et mener des projets sur des thématiques aussi diverses que la production, la supply chain, le marketing ou le développement commercial ;
réaliser des analyses et des modélisations mettant en oeuvre des techniques de machine learning (supervisés et non supervisés), de deep learning ou d’optimisation ;
construire des modèles, les intégrer dans des prototypes d’application et être à même de supporter leur industrialisation auprès du métier ;
communiquer efficacement avec vos clients pour partager vos analyses et résultats à l’aide de visualisations interactives, de présentations, de documents ou de notebooks ;
être à l’affût de nouvelles méthodes de machine learning et les partager avec le reste de l’équipe lors de nos séminaires internes.
Vous serez garant du cadrage, des propositions, de la maîtrise des délais et des ressources sur les études que vous aurez à mener.
Vous possédez de bonnes capacités relationnelles pour mener des projets dans une ambiance collaborative et pour établir des contacts :
internes au groupe Saint-Gobain : centres R&D, usines, directions industrielles, marketing, etc.
externes : startups, meetup, communautés de data science.
Des déplacements de courte durée sont à prévoir en France et à l’étranger, dans les lieux d’activité du groupe.
Profil recherché
Docteur-e ou Ingénieur-e en Mathématiques, Statistiques ou en Physique, diplômé-e d’une grande école ou universitaire, vous disposez d’une solide formation en analyse de données et en machine learning.
Vous maitrisez l’un des langages suivants : Python, R, C++ ;
Vous voulez appliquer vos savoirs à des problématiques industrielles ;
Vous êtes synthétique, clair(e) et avez de bonnes qualités de communication écrite et orale ;
Vous avez l’esprit d’équipe : vous avez un bon relationnel et aimez partager votre savoir ;
Vous faites spontanément de la veille en machine learning et aimez tester les dernières nouveautés ;
La maîtrise de l’anglais est indispensable pour le poste.
