Type d'emploi : Temps plein, CDI

Vos principales missions seront de :

Manipuler et exploiter des sources de données très variées (formats et contenus) dans un environnement Big Data afin d’optimiser les processus existants et identifier de nouveaux business cases ;
Interagir avec différents services pour développer la pérennisation de la data science notamment au travers d’enjeux liés au marketing ;
Apporter des solutions analytiques afin de répondre aux enjeux opérationnels à travers la création de modèles de machine learning et de clustering : algorithme de recommandation, look-alike, analyse comportementale, segmentation de clients, modèle prédictif ;
Produire des études statistiques ad hoc permettant de piloter la stratégie commerciale sur les produits ou les clients ;
