Open Digital Education, c’est quoi au juste ?
ODE(pour les intimes) est un réseau social éducatif qui donne un coup de vieux aux Espaces Numériques de Travail ! Notre solution s’inscrit dans l’ère du temps et participe à l’évolution des pratiques pédagogiques, pour favoriser la réussite scolaire des nouvelles générations.
2 millions, c’est le nombre d’élèves qui se connectent à notre réseau, dans l’hexagone et au-delà, pour apprendre autrement, partager, collaborer ensemble… la liste est longue ! Parmi nos solutions, déployées à grande échelle, découvre ONE, l’espace dédié aux écoles primaires, NEO, le réseau social adapté aux collèges et aux lycées, ou encore CCN, la résidence d'artistes en ligne.
