Tiller c'est quoi ?
Tiller est une startup en hypercroissance qui digitalise le secteur de la restauration ! Nous développons une application iPad complète qui permet aujourd’hui à plus de 6500 restaurateurs et commerçants de gérer leur affaire comme un vrai business, en passant par l'encaissement et l'intégration de services externes.
Mais surtout, Tiller c’est une équipe de plus de 170 rockstars à Paris, Milan et Barcelone qui bossent à fond pour aller le plus loin possible et devenir le leader européen sur notre marché. L'équipe technique actuelle (30 personnes) s'agrandit, on a donc besoin de toi !

Pourquoi Tiller, pourquoi maintenant ?
Une hypercroissance qui implique de nouvelles problématiques (hors-connexion, synchronisation, automatisation, interface avec nouveaux devices, qualité). Dans ce contexte, l'évolution de notre app est primordiale. De nombreux projets d'évolutions et créations de features qui n'attendent que toi pour être lancés.
Une V3 en cours d'évolution, une équipe expérimentée de 5 développeurs iOS, une application modulaire qui intègre des technologies modernes (Swift, Realm, RxSwift), une architecture CQRS, des interfaces avec de nombreux devices (imprimantes, scanners, Tpe) et des process qualité (SwiftLint, Fastlane, Jenkins).
Tiller ce n'est pas juste une startup : c'est une équipe survoltée et ambitieuse, un esprit et une ambiance comme tu n'en verras pas autre part.
Jette un oeil à notre Culture Book pour en savoir plus sur Tiller et nos rituels : https://bit.ly/2JVQfRL

Tes missions :
En tant que Développeur iOS, tu rejoindras une équipe de 28 personnes et dirigée par Vincent (EPITA), avec au programme :
Itérations sur notre produit actuel jusqu’au déploiement de nouvelles fonctionnalités innovantes;
Développement de nouvelles features sur la v3 (pod de réservations, gestion de fidélité, paiement par mobile) intégration de solutions partenaires, travaux de R&D (Corrélations des données);
Intégration de RxSwift et autres nouvelles technologies;
Participation active à la définition et au suivi de la Road Map technique, aux réflexions stratégiques globales de la startup;
Renforcer la culture tech de Tiller !
